// React
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

// Style
import { Navbar, Nav, Container } from 'react-bootstrap';

// Assets
import logo from '../public/lung-logo.svg';
import navIcon1 from '../public/nav-icon1.svg';
import navIcon2 from '../public/nav-icon2.svg';
import navIcon3 from '../public/nav-icon3.svg';


export const NavBar = () => {
    const [error, setError] = useState('');
    const [activeLink, setActiveLink] = useState('home');
    const [scrolled, setScrolled] = useState(false);
    const navigate = useNavigate();

    const handleSignIn = async (e) => {
        e.preventDefault();
        setError('');
        try {
            navigate('/login');
        } catch (error) {
            if (error instanceof Error) {
                setError(error.message);
            } else {
                setError(`Unexpected Error: ${error}`);
            }
        }
        console.log(error);
    };


    useEffect(() => {
        const onScroll = () => {
            if (window.scrollY > 50) {
                setScrolled(true);
            } else {
                setScrolled(false);
            }
        };

        window.addEventListener('scroll', onScroll);

        return () => window.removeEventListener('scroll', onScroll);
    }, []);

    const onUpdateActiveLink = (value) => {
        setActiveLink(value);
    };

    return (
        <Navbar expand="md" className={scrolled ? 'scrolled' : ''}>
            <Container>
                <Navbar.Brand href="/">
                    <img src={logo} alt="Logo" style={{ width: '112%', height: '112%' }} />

                </Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav">
                    <span className="navbar-toggler-icon"></span>
                </Navbar.Toggle>
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ms-auto">
                        <Nav.Link href="#home" className={activeLink === 'home' ? 'active navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('home')}>Home</Nav.Link>
                        <Nav.Link href="#impact" className={activeLink === 'impact' ? 'active navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('impact')}>Impact</Nav.Link>
                        <Nav.Link href="#projects" className={activeLink === 'projects' ? 'active navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('projects')}>CT scans</Nav.Link>
                        <Nav.Link href="#info" className={activeLink === 'info' ? 'active navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('info')}>Info</Nav.Link>
                        <Nav.Link href="#teams" className={activeLink === 'teams' ? 'active navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('teams')}>Team</Nav.Link>
                    </Nav>
                    <span className="navbar-text">
                        <div className="social-icon">
                            <a href="https://www.linkedin.com/company/fauengineering/"><img src={navIcon1} alt="" /></a>
                            <a href="https://www.facebook.com/fauengineering/"><img src={navIcon2} alt="" /></a>
                            <a href="https://www.instagram.com/fauengineering/"><img src={navIcon3} alt="" /></a>
                        </div>
                        <button className="vvd" onClick={handleSignIn}><span>Sign in</span></button>
                    </span>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
};
